import matplotlib.pyplot as plt
import matplotlib.animation as animation
import random

from simulation.storage_map import alternateMap
from simulation.storage_map import originMap

plt.rcParams['figure.dpi'] = 300

'''
完成动画绘制
'''

class simAnimation():
    def __init__(self, alternate_dict_list, map_size, cell_size, cells_shape):
        self.alternate_dict_list_int = alternate_dict_list
        self.map_size = map_size
        self.cell_size = cell_size
        self.cells_shape = cells_shape
        self.im = None

        self.alter_map = alternateMap(map_size, alternate_dict_list, cells_shape)

    def show_simu(self, update_cells, gif_save=0):
        figure = plt.figure('simu process')
        storage_map = self.alter_map

        def init():
            pic = storage_map.alternate_map(self.map_size, self.alternate_dict_list_int, self.cells_shape)
            self.im = plt.imshow(pic, animated=True)

        def update(update_cell):
            pic = storage_map.update_alternate_map(self.map_size, update_cell, self.cells_shape)
            self.im.set_array(pic)
            return pic

        # plt.axis("off")
        ani = animation.FuncAnimation(figure, update, frames=update_cells, interval=300, init_func=init, blit=False)
        plt.ioff()

        if gif_save == 1:
            ani.save(f'./output/seq_unit_{str(random.randint(0, 9999))}.gif', writer='imagemagick', fps=10)

        plt.show()


